(257, 1, '2019-02-01 09:09:45', '2019-02-01 09:09:45', '[vc_row css=".vc_custom_1551505856871{margin-bottom: 0px !important;padding-right: 0px !important;}" el_class="about_us_2"][vc_column width="1/2" el_class="transworld" css=".vc_custom_1551525389519{padding-top: 0px !important;padding-bottom: 70px !important;background-color: #dc291b !important;}"][vc_raw_html el_class="about_us_1" css=".vc_custom_1551505123915{margin-top: 70px !important;margin-bottom: 0px !important;}"][/vc_raw_html][/vc_column][vc_column width="1/2" css=".vc_custom_1551503642515{margin-bottom: 0px !important;padding-top: 0px !important;padding-right: 25px !important;padding-bottom: 25px !important;padding-left: 25px !important;background-color: #ededed !important;}"][vc_column_text css=".vc_custom_1551503652045{margin-top: 25px !important;margin-bottom: 0px !important;}"]<big>Transworld is the principal Indian associate ofÂ <strong>Davao Medical School Foundation (DMSF)</strong>,\r\na leading medical educational institute of Philippines. Transworld Educare aims at providing quality healthcare education for all people and to construct a socially ethical graduate.</big>\r\n\r\n<strong><big>Transworld Educare Pvt Ltd.</big></strong>Â <big>a registered company, established in the year 1999. It aims at offering pre-recruitment and recruitment drives to the Indian students, for educational institutions across the globe. Transworld, located in Pune aims at providing quality education for Indian students. It is known for its achievements in the field of medical education. It is also the pioneer in identifying and introducing the Republic of Philippines for the Indian students for their medical education.</big>[/vc_column_text][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column width="1/2" css=".vc_custom_1551505910512{padding-right: 25px !important;padding-bottom: 25px !important;padding-left: 25px !important;background-color: #ededed !important;}" el_class="about_us_3"][vc_column_text css=".vc_custom_1551508847954{margin-top: 18px !important;margin-bottom: 25px !important;}"]\r\n<h3>How we work</h3>\r\nMost of the Indian students seek admission in countries like Russia, China &amp; other European countries to pursue the medical education. Having understood the studentâs needs and complications they face in other countries, Transworld helps students by placing them in the republic of Philippines which provides the medical education similar to India. Unlike China and Russia, Philippines does not have any language barriers in their learning process as the medium of instruction in the Philippines is English. Transworld Educare tops in providing quality education in B.s course in India.\r\n\r\nTransworld is the principal Indian associate of Davao Medical School Foundation (DMSF), a leading medical educational institute of Philippines. Transworld Educare aims at providing quality healthcare education for all people and to construct a socially ethical graduate.[/vc_column_text][vc_column_text css=".vc_custom_1551508802922{margin-bottom: 0px !important;border-bottom-width: 0px !important;padding-bottom: 0px !important;padding-left: 0px !important;}"]\r\n<h3>About Campus</h3>\r\nTransworld is the Principal Education Associate of Davao Medical School Foundation in India and has been providing a pathway to Medical Education for close to two decades. Transworld is the pioneer who introduced Philippines as the ideal choice to Indian Students for Medical Education. Transworld with its rich experience and knowledge provides one stop solution for Indian Medical Aspirants to pursue MBBS (MD) studies at DMSF.[/vc_column_text][/vc_column][vc_column width="1/2" css=".vc_custom_1551520119840{border-right-width: 0px !important;padding-left: 0px !important;background-color: #ededed !important;}" el_class="about_us_4"][volcanno_nivo_slider nivo_style="nivo-slider-01" slide_group="%5B%7B%22image%22%3A%22471%22%7D%2C%7B%22image%22%3A%22473%22%7D%5D" height="800" design_p