lleges The college is affiliated to Southern i Center, Davag Doctors Hospital, Brokenshire Hospital &amp; San Pedro Hospital all of which have a combined bed strength of 4000 giving the students an overwhelming edge when it comes to clinical exposure.[/vc_column_text][vc_column_text css=".vc_custom_1551528014576{margin-bottom: 0px !important;border-bottom-width: 0px !important;padding-bottom: 0px !important;padding-left: 0px !important;}"]\n<h3>HOSTEL FACILITIES</h3>\nDedicated hostel facilities are provided exclusively for Indian students. Separate hostel facilities are made for boys and girls which are fully air conditioned and monitored. In all over 50 Indian staff and over 150 Filipino staff are assigned for the sole purpose of taking care of the students. Premium hostels are available for students who are in need of privacy.[/vc_column_text][vc_column_text css=".vc_custom_1551528179320{margin-bottom: 0px !important;border-bottom-width: 0px !important;padding-bottom: 0px !important;padding-left: 0px !important;}"]\n<h3>CANTEEN FACILITIES</h3>\nSpecial indian food prepared by highly skilled indian cooks with the option of vegetarian and non-vegetarian dishes. healthy and hygienic food is provided to the students at the hostel and at the college. all indian festivals are celebrated throughout the year with great zeal and enth- usiasm, to make sure that the students never feel that they are away from home.[/vc_column_text][/vc_column][vc_column width="1/2" css=".vc_custom_1551520119840{border-right-width: 0px !important;padding-left: 0px !important;background-color: #ededed !important;}" el_class="about_us_4"][volcanno_nivo_slider nivo_style="nivo-slider-01" slide_group="%5B%7B%22image%22%3A%22507%22%7D%2C%7B%22image%22%3A%22508%22%7D%5D" height="800" design_param=".vc_custom_1551527480946{margin-right: 0px !important;padding-right: 0px !important;}"][volcanno_nivo_slider nivo_style="nivo-slider-01" slide_group="%5B%7B%22image%22%3A%22507%22%7D%2C%7B%22image%22%3A%22508%22%7D%5D" height="800" design_param=".vc_custom_1551527480946{margin-right: 0px !important;padding-right: 0px !important;}"][vc_single_image image="344" img_size="large" onclick="link_image" css=".vc_custom_1551528118011{margin-right: 0px !important;margin-bottom: 0px !important;border-bottom-width: 0px !important;padding-right: 0px !important;padding-bottom: 0px !important;}"][vc_single_image image="348" img_size="large" onclick="link_image" css=".vc_custom_1551528229445{margin-right: 0px !important;margin-bottom: 0px !important;border-bottom-width: 0px !important;padding-right: 0px !important;padding-bottom: 0px !important;}"][/vc_column][/vc_row][vc_row full_width="stretch_row" equal_height="yes" content_placement="middle" css=".vc_custom_1551525404465{margin-top: 0px !important;margin-bottom: 0px !important;padding-top: 20px !important;padding-bottom: 20px !important;background-color: #dc291b !important;}" el_class="about_us_6"][vc_column width="1/4" css=".vc_custom_1551511751939{padding-left: 0px !important;}" el_class="about_us_5"][vc_single_image image="286" img_size="large" add_caption="yes" onclick="link_image" css=".vc_custom_1551520448338{margin-top: 0px !important;margin-bottom: 0px !important;}"][/vc_column][vc_column width="3/4" css=".vc_custom_1549023844839{padding-right: 0px !important;padding-left: 0px !important;}"][volcanno_heading heading_style="custom-heading-03" title="Mr. David K Pillai" title_size="h3" style="custom" design_param=".vc_custom_1551520297705{margin-top: 20px !important;margin-bottom: 0px !important;}"][vc_column_text el_class="about_us_principal_text"]Transworld Educare Pvt. Ltd. is where knowledge reigns supreme. Our aim is to groom each student academically and socially so that he/she becomes very confident and well balanced citizens and doctors of the world. Our association with Davao Medical School Foundation brings with it a tremendous responsibility as well as an opportunity to take up the challenge to promote our Indian students to the global limelight in the Medical field. The academic curriculum framed by the University/School is with a focused vision and mission to impart education of highest standards and hands on experience, clinical training that will completely develop every skill of these young doctors. Hereâs wishing everyone success and hope that this journey, though convoluted and challenging will be a successful and fulfilling one.[/vc_column_text][/vc_column][/vc_row]', 'DAVAO', '', 'inherit', 'closed', 'closed', '', '320-autosave-v1', '', '', '2019-03-02 12:11:29', '2019-03-02 12:11:29', '', 320, 'http://localhost/transworldeducare/2019/02/01/320-autosave-v1/', 0, 'revision', '', 0),
