 in India and has been providing a pathway to Medical Education for close to two decades. Transworld is the pioneer who introduced Philippines as the ideal choice to Indian Students for Medical Education. Transworld with its rich experience and knowledge provides one stop solution for Indian Medical Aspirants to pursue MBBS (MD) studies at DMSF.[/vc_column_text][/vc_column][/vc_row][vc_row equal_height="yes" content_placement="middle" css=".vc_custom_1549025899809{margin-top: 50px !important;margin-bottom: 40px !important;padding-top: 0px !important;padding-bottom: 20px !important;}"][vc_column width="2/3" css=".vc_custom_1549025846136{padding-left: 0px !important;}"][volcanno_heading heading_style="custom-heading-03" title="Mr. David K Pillai" title_size="h3" style="custom"][vc_column_text]Transworld Educare Pvt. Ltd. is where knowledge reigns supreme. Our aim is to groom each student academically and socially so that he/she becomes very confident and well balanced citizens and doctors of the world. Our association with Davao Medical School Foundation brings with it a tremendous responsibility as well as an opportunity to take up the challenge to promote our Indian students to the global limelight in the Medical field. The academic curriculum framed by the University/School is with a focused vision and mission to impart education of highest standards and hands on experience, clinical training that will completely develop every skill of these young doctors. Hereâs wishing everyone success and hope that this journey, though convoluted and challenging will be a successful and fulfilling one.[/vc_column_text][/vc_column][vc_column width="1/3" css=".vc_custom_1549023844839{padding-right: 0px !important;padding-left: 0px !important;}"][vc_single_image image="286" img_size="large" add_caption="yes" onclick="link_image"][/vc_column][/vc_row]', 'Pune Campus', '', 'inherit', 'closed', 'closed', '', '257-revision-v1', '', '', '2019-03-02 05:09:30', '2019-03-02 05:09:30', ''