tant;}"]<strong>How we work</strong>\r\nMost of the Indian students seek admission in countries like Russia, China &amp; other European countries to pursue the medical education. Having understood the studentâs needs and complications they face in other countries, Transworld helps students by placing them in the republic of Philippines which provides the medical education similar to India. Unlike China and Russia, Philippines does not have any language barriers in their learning process as the medium of instruction in the Philippines is English. Transworld Educare tops in providing quality education in B.s course in India.\r\n\r\nTransworld is the principal Indian associate of Davao Medical School Foundation (DMSF), a leading medical educational institute of Philippines. Transworld Educare aims at providing quality healthcare education for all people and to construct a socially ethical graduate.[/vc_column_text][/vc_column][vc_column width="1/2"][vc_single_image image="275" img_size="large" alignment="center" onclick="img_link_large"][/vc_column][/vc_row][vc_row css=".vc_custom_1549024284572{margin-top: 80px !important;margin-bottom: 0px !important;padding-top: 20px !important;padding-bottom: 20px !important;}"][vc_column][volcanno_heading heading_style="custom-heading-02" title="TRANSWORLD CAMPUS PUNE" style="custom" extra_class_param="topline-custom-center" design_param=".vc_custom_1549025326863{margin-bottom: 0px !important;}"][/vc_column][/vc_row][vc_row equal_height="yes" content_placement="middle" css=".vc_custom_1549025765083{margin-bottom: 0px !important;border-bottom-width: 0px !important;padding-top: 20px !important;padding-bottom: 0px !important;}"][vc_column width="1/3" css=".vc_custom_1549023879710{padding-right: 0px !important;padding-left: 0px !important;}"][vc_single_image image="275" img_size="large" onclick="link_image" css=".vc_custom_1549023798495{margin-bottom: 0px !important;border-bottom-width: 0px !important;padding-bottom: 0px !important;}"][/vc_column][vc_column width="2/3" el_class="vertical-center"][vc_column_text css=".vc_custom_1549025809529{margin-bottom: 0px !important;border-bottom-width: 0px !important;padding-bottom: 0px !important;padding-left: 20px !important;}"]Transworld is the Principal Education Associate of Davao Medical School Foundation in India and has been providing a pathway to Medical Education for close to two decades. Transworld is the pioneer who introduced Philippines as the ideal choice to Indian Students for Medical Education. Transworld with its rich experience and knowledge provides one stop solution for Indian Medical Aspirants to pursue MBBS (MD) studies at DMSF.[/vc_column_text][/vc_column][/vc_row][vc_row equal_height="yes" content_placement="middle" css=".vc_custom_1549025899809{margin-top: 50px !important;margin-bottom: 40px !important;padding-top: 0px !important;padding-bottom: 20px !important;}"][vc_column width="2/3" css=".vc_custom_1549025846136{padding-left: 0px !important;}"][volcanno_heading heading_style="custom-heading-03" title="Mr. David K Pillai" title_size="h3" style="custom"][vc_column_text]Transworld Educare Pvt. Ltd. is where knowledge reigns supreme. Our aim is to groom each student academically and socially so that he/she becomes very confident and well balanced citizens and doctors of the world. Our association with Davao Medical School Foundation brings with it a tremendous responsibility as well as an opportunity to take up the challenge to promote our Indian students to the global limelight in the Medical field. The academic curriculum framed by the University/School is with a focused vision and mission to impart education of highest standards and hands on experience, clinical training that will completely develop every skill of these young doctors. Hereâs wishing everyone success and hope that this journey, though convoluted and challenging will be a successful and fulfilling one.[/vc_column_text][/vc_column][vc_column width="1/3" css=".vc_custom_1549023844839{padding-right: 0px !important;padding-left: 0px !important;}"][vc_single_image image="286" img_size="large" add_caption="yes" onclick="link_image"][/vc_column][/vc_row]', 'Pune Campus', '', 'inherit', 'closed', 'closed', '', '257-revision-v1', '', '', '2019-03-02 05:48:22', '2019-03-02 05:48:22', '', 257, 'http://localhost/transworldeducare/2019/03/02/257-revision-v1/', 0, 'revision', '', 0),
