(458, 1, '2019-03-02 06:23:51', '2019-03-02 06:23:51', '[vc_row css=".vc_custom_1551505856871{margin-bottom: 0px !important;padding-right: 0px !important;}" el_class="about_us_2"][vc_column width="1/2" el_class="transworld" css=".vc_custom_1551504972475{padding-top: 0px !important;padding-bottom: 70px !important;background-color: #f71b59 !important;}"][vc_raw_html el_class="about_us_1" css=".vc_custom_1551505123915{margin-top: 70px !important;margin-bottom: 0px !important;}"][/vc_raw_html][/vc_column][vc_column width="1/2" css=".vc_custom_1551503642515{margin-bottom: 0px !important;padding-top: 0px !important;padding-right: 25px !important;padding-bottom: 25px !important;padding-left: 25px !important;background-color: #ededed !important;}"][vc_column_text css=".vc_custom_1551503652045{margin-top: 25px !important;margin-bottom: 0px !important;}"]<big>Transworld is the principal Indian associate ofÂ <strong>Davao Medical School Foundation (DMSF)</strong>,\r\na leading medical educational institute of Philippines. Transworld Educare aims at providing quality healthcare education for all people and to construct a socially ethical graduate.</big>\r\n\r\n<strong><big>Transworld Educare Pvt Ltd.</big></strong>Â <big>a registered company, established in the year 1999. It aims at offering pre-recruitment and recruitment drives to the Indian students, for educational institutions across the globe. Transworld, located in Pune aims at providing quality education for Indian students. It is known for its achievements in the field of medical education. It is also the pioneer in identifying and introducing the Republic of Philippines for the Indian students for their medical education.</big>[/vc_column_text][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column width="1/2" css=".vc_custom_1551505910512{padding-right: 25px !important;padding-bottom: 25px !important;padding-left: 25px !important;background-color: #ededed !important;}" el_class="about_us_3"][vc_column_text c