ing that will completely develop every skill of these young doctors. Hereâs wishing everyone success and hope that this journey, though convoluted and challenging will be a successful and fulfilling one.[/vc_column_text][/vc_column][vc_column width="1/3" css=".vc_custom_1549023844839{padding-right: 0px !important;padding-left: 0px !important;}"][vc_single_image image="286" img_size="large" add_caption="yes" onclick="link_image"][/vc_column][/vc_row]', 'Pune Campus', '', 'inherit', 'closed', 'closed', '', '257-revision-v1', '', '', '2019-03-02 06:58:07', '2019-03-02 06:58:07', '', 257, 'http://localhost/transworldeducare/2019/03/02/257-revision-v1/', 0, 'revision', '', 0),
