ssful and fulfilling one.[/vc_column_text][/vc_column][/vc_row]', 'Pune Campus', '', 'inherit', 'closed', 'closed', '', '257-revision-v1', '', '', '2019-03-02 07:24:11', '2019-03-02 07:24:11', '', 257, 'http://localhost/transworldeducare/2019/03/02/257-revision-v1/', 0, 'revision', '', 0),
