dding-right: 0px !important;padding-bottom: 0px !important;}"][/vc_column][/vc_row][vc_row full_width="stretch_row" equal_height="yes" content_placement="middle" css=".vc_custom_1551525404465{margin-top: 0px !important;margin-bottom: 0px !important;padding-top: 20px !important;padding-bottom: 20px !important;background-color: #dc291b !important;}" el_class="about_us_6"][vc_column width="1/4" css=".vc_custom_1551511751939{padding-left: 0px !important;}" el_class="about_us_5"][vc_single_image image="286" img_size="large" add_caption="yes" onclick="link_image" css=".vc_custom_1551520448338{margin-top: 0px !important;margin-bottom: 0px !important;}"][/vc_column][vc_column width="3/4" css=".vc_custom_1549023844839{padding-right: 0px !important;padding-left: 0px !important;}"][volcanno_heading heading_style="custom-heading-03" title="Mr. David K Pillai" title_size="h3" style="custom" design_param=".vc_custom_1551520297705{margin-top: 20px !important;margin-bottom: 0px !important;}"][vc_column_text el_class="about_us_principal_text"]Transworld Educare Pvt. Ltd. is where knowledge reigns supreme. Our aim is to groom each student academically and socially so that he/she becomes very confident and well balanced citizens and doctors of the world. Our association with Davao Medical School Foundation brings with it a tremendous responsibility as well as an opportunity to take up the challenge to promote our Indian students to the global limelight in the Medical field. The academic curriculum framed by the University/School is with a focused vision and mission to impart education of highest standards and hands on experience, clinical training that will completely develop every skill of these young doctors. Hereâs wishing everyone success and hope that this journey, though convoluted and challenging will be a successful and fulfilling one.[/vc_column_text][/vc_column][/vc_row]', 'DAVAO', '', 'inherit', 'closed', 'closed', '', '320-revision-v1', '', '', '2019-03-02 11:43:03', '20