(521, 1, '2019-03-02 12:09:18', '2019-03-02 12:09:18', '[vc_row css=".vc_custom_1551505856871{margin-bottom: 0px !important;padding-right: 0px !important;}" el_class="about_us_2"][vc_column width="1/2" el_class="transworld" css=".vc_custom_1551527302855{padding-top: 0px !important;padding-bottom: 13px !important;background-color: #dc291b !important;}"][vc_raw_html el_class="about_us_1" css=".vc_custom_1551527290911{margin-top: 13px !important;margin-bottom: 0px !important;}"][/vc_raw_html][/vc_column][vc_column width="1/2" css=".vc_custom_1551503642515{margin-bottom: 0px !important;padding-top: 0px !important;padding-right: 25px !important;padding-bottom: 25px !important;padding-left: 25px !important;background-color: #ededed !important;}"][vc_column_text css=".vc_custom_1551526982584{margin-top: 25px !important;margin-bottom: 0px !important;}"]<strong>Davao</strong> is a highly urbanized city in the island of Mindanao in the Philippines. It is the largest city in the Philippines in terms of land area, and the most populous city in the country outside Metro Manila. It has been described as one of the safest cities in the world and has been awarded the âBest of the livable Cities in the Philippinesâ by the Department of Tourism. Davao is one of the fastest growing cities in Asia with a stable peace order and economic growth remains attractive and is the preferred choice for foreign students.[/vc_column_text][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column width="1/2" css=".vc_custom_1551505910512{padding-right: 25px !important;padding-bottom: 25px !important;padding-left: 25px !important;background-color: #ededed !important;}" el_class="about_us_3"][vc_column_text css=".vc_custom_1551528197855{margin-top: 18px !important;margin-bottom: 25px !important;}"]\r\n<h3>DMFS College</h3>\r\nDavao Medical School Foundation was established in the year 1976, and is one of the top performing medical schools in Philippines being placed amongst the Top 6 medica